  render(){
    return (
        <div>
        <Image width="100%" rounded src={require('../img/blog.jpg')}/>
        <Menu>
        <Menu.Item>
            <Link to="/login/" style={{color:'black'}}>
                <div>Please Log in</div>
            </Link>
        </Menu.Item>
        <Menu.Item>
            <Link to="/Test/" style={{color:'black'}}>
                <div>Test</div>
            </Link>
        </Menu.Item>
        </Menu>

    </div>


    )
  }

  componentDidMount() {
    console.log(this.props.match.params.username);
